import React , { useState } from 'react';





const Meal=()=>{
  const [mealData, setmealData] = useState(null);
  const [recCard, setrecCard] = useState(null);

  
  
    fetch(
        'http://www.themealdb.com/api/json/v1/1/search.php?s=Biryani'
      )
        .then((response) => response.json())
        .then((data) => {
          setmealData(data[0].protein)
        })
        .catch(() => {
          console.log("error");
        });
    
        fetch(
          'https://api.spoonacular.com/recipes/4632/card?apiKey=a9b075e6656c45f587b86cba1c8c3789'
        )
          .then((response) => response.json())
          .then((data) => {
            setrecCard(data.url)
          })
          .catch(() => {
            console.log("error");
          });

    


 
  return (
    <div>
      <h1>{mealData}</h1>
      <img src={recCard} alt="recepie card" />
    </div>
  )
}
export default Meal;
